{% if price__number__number > 0 %}
     {{ price__number }} / {{ field_recurring_interval|lower }}
{% else %}
   {{ "Free"|t }}
{% endif %}

{% if status == 'Active' %}
    <a href="/user/{{ arguments.uid }}/subscription/update" class="button button--primary btn  btn-primary">Change</a>
    <a href="/user/{{ arguments.uid }}/subscription/{{ sid }}/cancel" class="button button--primary btn  btn-primary">Cancel</a>
{% endif %}
